import React from 'react'

export default function Counter() {
    let number = 0
    const handleIncrease = () => {
        number++;
        console.log(number)
    }
    const handleDecrease = () => {
        number--;
        console.log(number)
    }
    return (
        <div>
            <h1>
            {number}
            </h1>
            <button onClick={handleIncrease}>Increase</button>
            <button onClick={handleDecrease}>Decrease</button>
        </div>
    )
}
